import React, { useEffect, useState } from 'react';
import '../styles/league.css';

function League() {
  const [standings, setStandings] = useState([]);

  useEffect(() => {
    fetch('/Users/ang3l/Documents/Software Engineering/cs373-idb/backend/leagues.json')
      .then(response => response.json())
      .then(data => {
        const league = data['Premier League'];
        if (league.id === 1) {
          setStandings(Object.values(league.standings));
        }
      })
      .catch(error => console.error('Error fetching the JSON file:', error));
  }, []);

  return (
    <div className="container">
      <h1 className="my-4">Premier League Standings</h1>
      <table id="standingsTable" className="table table-striped table-bordered">
        <thead className="thead-dark">
          <tr>
            <th>Position</th>
            <th>Team</th>
            <th>Points</th>
            <th>Games Won</th>
            <th>Games Lost</th>
            <th>Goals For</th>
            <th>Goals Against</th>
            <th>Goal Difference</th>
          </tr>
        </thead>
        <tbody>
          {standings.map(team => (
            <tr key={team.id}>
              <td>{team.position}</td>
              <td>
                <img
                  src={team.team_crest}
                  alt={team.name}
                  style={{ height: '20px', verticalAlign: 'middle' }}
                />{' '}
                {team.name}
              </td>
              <td>{team.points}</td>
              <td>{team.games_won}</td>
              <td>{team.games_lost}</td>
              <td>{team.goals_for}</td>
              <td>{team.goals_against}</td>
              <td>{team.goal_difference}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <footer>
        <small>Copyright Â© 2024. Hatttrick. All Rights Reserved.</small>
      </footer>
    </div>
  );
}

export default League;
